import{_ as e,o as t,c as a,d as r}from"./app.e94dbe1f.js";const m=JSON.parse('{"title":"eduweb & ahoy!","description":"","frontmatter":{"title":"eduweb & ahoy!"},"headers":[],"relativePath":"Projects/eduweb.md"}'),o={name:"Projects/eduweb.md"},i=r('<h1 id="eduweb-ahoy" tabindex="-1">eduweb &amp; ahoy! <a class="header-anchor" href="#eduweb-ahoy" aria-hidden="true">#</a></h1><p>eduweb is an educational platform with video courses for tech outliers. Ahoy! is a closed, paid community for them. Both projects are using <a href="./easy_.html">easy_</a> for managing subscriptions and premium content access. We are using a lot of <a href="./../Tools/Automation.html">Automation</a>s which allow us to do it all in a very small team.</p><p>I&#39;ve published many courses and hundreds of articles and posts both on eduweb and ahoy! You can find an examples below.</p><p><strong>Newsletter on Autopilot</strong></p><p>I use automation to optimize a process for creating my newsletters. This includes generating graphics, social media posts and also configuring and archiving. In this course I teach how to use Airtable, Shortcuts and MailerLite to create newsletters way easier.</p><p>\u{1F517} <a href="https://eduweb.pl/marketing-i-biznes/biznes/newsletter-na-autopilocie" target="_blank" rel="noreferrer">Course page</a></p><p><strong>Keyboard Maestro</strong> (PL)</p><p>Keyboard Maestro is a macOS application that allows you to automate almost any action you do on your mac. In this course, you will find practical examples and inspiration to help you create simple and powerful macros that will save you hours of work.</p><p>\u{1F517} <a href="https://eduweb.pl/marketing-i-biznes/biznes/keyboard-maestro-automatyzacja-macos?ref=overment" target="_blank" rel="noreferrer">Course page</a></p><p><strong>TypeScript (PL)</strong></p><p>If you need to learn TypeScript, this is a good way to start. I&#39;ve created two courses, but both of them you may consider as &quot;introduction&quot; and a blazing-speed start.</p><p>\u{1F517} <a href="https://eduweb.pl/programowanie-i-www/typescript/typescript-podstawy?ref=overment" target="_blank" rel="noreferrer">Basics</a> &amp; \u{1F517} <a href="https://eduweb.pl/programowanie-i-www/typescript/typescript-techniki-zaawansowane?ref=overment" target="_blank" rel="noreferrer">Intermediate</a></p><p><strong>Types in JavaScript (PL)</strong></p><p>This is a workshop about types in JavaScript and their importance in the context of TypeScript. You can learn here i.e. what are statics and dynamic types and why you should learn TypeScript.</p><p>\u{1F517} <a href="https://eduweb.pl/programowanie-i-www/typescript/wszystko-o-typach?ref=overment" target="_blank" rel="noreferrer">Watch Now</a></p><p><strong>Is it worth to learn TypeScript?</strong></p><p>In this workshop I show a couple of examples which will tel you when it is really worth to learn TypeScript and when it&#39;s not.</p><p>\u{1F517} <a href="https://eduweb.pl/programowanie-i-www/typescript/czy-warto-uczyc-sie-typescript?ref=overment" target="_blank" rel="noreferrer">Watch now</a></p><p><strong>Regex for Web Developer</strong></p><p>In this video you will find a minimum necessary knowledge of Regex, which you will find useful in your daily work. This is a very important skill both for Programming and <a href="./../Tools/Automation.html">Automation</a>s.</p><p>\u{1F517} <a href="https://eduweb.pl/programowanie-i-www/javascript/regex-dla-webdevelopera?ref=overment" target="_blank" rel="noreferrer">Watch now</a></p><p><strong>ES2019 &amp; ES2020</strong></p><p>A video describing the most important features of ES2019 and ES2019 including:</p><ul><li>Object.entries() &amp; Object.fromEntries()</li><li>Array.flat() &amp; Array.flatMap()</li><li>trimStart() / trimEnd()</li><li>Optional Chaining &amp; Nullish coalescing</li><li>String.prototype.matchAll()</li><li>Promise.allSettled()</li><li>globalThis</li><li>BigInt</li><li>Symbol.description</li></ul><p>\u{1F517} <a href="https://eduweb.pl/programowanie-i-www/javascript/nowosci-w-ecmascript-2019-20?ref=overment" target="_blank" rel="noreferrer">Watch now</a></p><p><strong>Asynchronous JavaScript</strong></p><p>In this workshop I explain the most important concepts about asynchronicity in the JavaScript like for example Event Loop, Higher-Order Functions, Currying, Pure Functions, Callbacks, Promises, async / await syntax and error handling.</p><p>\u{1F517} <a href="https://eduweb.pl/programowanie-i-www/javascript/asynchronicznosc-w-javascript-krok-po-kroku?ref=overment" target="_blank" rel="noreferrer">Watch now</a></p><p><strong>Advanced debugging in JavaScript</strong></p><p>This workshop covers the most important techniques for debugging JavaScript code using both Chrome Dev Tools and the built-in debugger in Visual Studio Code. The whole thing takes into account both client-side (Vue) and server-side (Nest) application debugging.</p><p>\u{1F517} <a href="https://eduweb.pl/programowanie-i-www/javascript/zaawansowane-debugowanie-javascript-i-nodejs?ref=overment" target="_blank" rel="noreferrer">Watch now</a></p><p><strong>JavaScript without any secrets</strong></p><p>In this workshop I explain a key concepts of JavaScript, that often cause many problems even for experienced developers like for ex.:</p><ul><li>Global, local and block scope</li><li>Hoisting and Temporal Dead Zone</li><li>Closures</li><li>&quot;this&quot; keyword</li><li>Metody call, apply i bind</li><li>Modules</li><li>Passing information by value and reference</li><li>Copying and freezing objects</li></ul><p>\u{1F517} <a href="https://eduweb.pl/programowanie-i-www/javascript/javascript-bez-tajemnic?ref=overment" target="_blank" rel="noreferrer">Watch now</a></p>',35),n=[i];function s(p,l,c,h,d,u){return t(),a("div",null,n)}const g=e(o,[["render",s]]);export{m as __pageData,g as default};
